en the webhook will fire.'=>'Sélectionnez quand lo croquet Web se déclenchera.','Custom'=>'Personnalisation','URL where the webhook payload is delivered.'=>'URL sus laquelle la connexion del croquet Web es déliurada.','Secret'=>'Secret','Created at'=>'Créé le','Updated at'=>'Actualizat le','Customer shipping address'=>'Adreça de liurason del client','Customer billing address'=>'Adreça de facturacion del client','Rounding'=>'Arrondi','Round tax at subtotal level, instead of rounding per line'=>'Arrondir la TVA al niveau del sostotals, plutôt que per chaque linha','Including tax'=>'TTC','Excluding tax'=>'HT','As a single total'=>'Comme un total unique','There are currently no logs to view.'=>'Il n&rsquo;y a actualament aucun log a afichar.','Please copy and paste this information in your ticket when contacting support:'=>'Copiatz-pegatz aquesta informacion dins votre ticket quand vous contactatz lo support&nbsp;:','Calculate coupon discounts sequentially'=>'Calcular les remises de còdis promo séquentiellement','Pay'=>'Payer','Emails'=>'E-mails','"From" name'=>'"From" Nom','Specific Countries'=>'Pays spécifiques','Shop base address'=>'Adreça de basa de la botiga','Geolocate'=>'Géolocalisation','This is a demo store for testing purposes &mdash; no orders shall be fulfilled.'=>'Aquò es una botiga de démonstration per test &mdash; aucune comanda ne serà honorée.','Currency'=>'Devise','Integration'=>'Intégration','The base page can also be used in your <a href="%s">product permalinks</a>.'=>'La pagina de basa pòt également èsser utilizada dins votre <a href="%s">permalien produit</a>.','This sets the base page of your shop - this is where your product archive will be.'=>'Aquò determina la pagina de départ de vòstra botiga - c&rsquo;est l&rsquo;emplaçament où votre archive de produits sera.','Show products'=>'Afichar los produits','Show subcategories'=>'Afichar les soscategorias','Default sorting (custom ordering + name)'=>'Triada per defaut (ordre personalizat + nom)','Sort by most recent'=>'Triada per lo mai recent','Enable stock management'=>'Activar la gestion de l\'estòc','Hold stock (for unpaid orders) for x minutes. When this limit is reached, the pending order will be cancelled. Leave blank to disable.'=>'Manténer l\'estòc (pour les comandas impayées) pendant x minutas. Quand aqueste délai serà atteint, la comanda en espèra serà anullada. Laisser vide per désactivar.','Downloads require login'=>'Les telecargaments nécessitent d&rsquo;èsser identifié','Grant access to downloadable products after payment'=>'Autorizar l&rsquo;accès aux produits telecargables après lo pagament','Enable this option to grant access to downloads when orders are "processing", rather than "completed".'=>'Activar aquesta opcion per autorizar l&rsquo;accès  aux telecargaments quand les comandas son "en cors", plutôt que "acabada".','A 2 digit country code, e.g. US. Leave blank to apply to all.'=>'Un còdi pays de 2 caractèrs, ex. FR. Daissatz vide per aplicar a tous.','A 2 digit state code, e.g. AL. Leave blank to apply to all.'=>'Un còdi estat de 2 caractèrs, ex. AL. Daissatz vide per aplicar a tous.','Cities for this rule. Semi-colon (;) separate multiple values. Leave blank to apply to all cities.'=>'Communes per aquesta règle. Lo point virgule (;) sépare les valors multiples. Laisser vide per aplicar a totas las communes.','Rate&nbsp;%'=>'Taus&nbsp;%','Choose a priority for this tax rate. Only 1 matching rate per priority will be used. To define multiple tax rates for a single area you need to specify a different priority per rate.'=>'Causir una prioritat per aqueste taux de TVA. Seul 1 taux correspondant per prioritat serà utilizat. Per définir des taux de TVA multiples per una seule zone vous devez spécifier una prioritat diferenta per taux.','This option is important as it will affect how you input prices. Changing it will not update existing products.'=>'Aquesta opcion es importante perque elle affecte la façon dont vous sasissètz les tarifs. La modificar ne mettra pas a jour des produits existant.','Yes, I will enter prices inclusive of tax'=>'Òc, je sasirai les tarifs TTC','No, I will enter prices exclusive of tax'=>'Non, je sasirai les tarifs HT','This option determines which address is used to calculate tax.'=>'Aquesta opcion determina quelle adreça es utilizada per lo calcul de TVA.','Optionally control which tax class shipping gets, or leave it so shipping tax is based on the cart items themselves.'=>'Opcionalament determina quelle classa de TVA de liurason définir, o laisser de tal biais que la TVA de liurason soit basée suls articles del panièr.','Shipping tax class based on cart items'=>'Classa de TVA de liurason basée suls articles panièr','Coupons can be applied from the cart and checkout pages.'=>'Les còdis promo pòdon èsser appliqués dempuèi lo panièr e las paginas de comanda.','When applying multiple coupons, apply the first coupon to the full price and the second coupon to the discounted price and so on.'=>'Lors de l&rsquo;aplicacion de còdis promo, aplicar lo premier còdi promo al plein tarif, lo deuxième còdi promo al tarif remesat e ainsi de suite.','Force secure checkout'=>'Forçar la comanda sécurisée','Force HTTP when leaving the checkout'=>'Forçar HTTP quand l&rsquo;on quitte la comanda','If you define a "Terms" page the customer will be asked if they accept them when checking out.'=>'Se vous définissez una pagina "Conditions Générales de Venda" il serà demandat al client d&rsquo;acceptar ces CGV lors de la comanda.','This option lets you limit which countries you are willing to sell to.'=>'Aquesta opcion vous permet de limitr los païses sus lesquels vous souhaitez vendre.','The following options affect how prices are displayed on the frontend.'=>'Les opcions seguentas déterminent la manière dont los prèses son afichats sul site.','This sets the thousand separator of displayed prices.'=>'Aquò determina lo séparateur de milliers pels prèses afichats.','This sets the decimal separator of d